import Header from './Header.jsx';
import React, { Component } from 'react';

var curState = "fdsfd";



class TodoApp extends React.Component{

  constructor(props){
    super(props);
    this.changeState = this.changeState.bind(this);
  }

  changeState(state){
    curState = state;
  }

  render(){
    return (
      <div>
            <Header changeState={this.changeState} />
            {curState}
      </div>
    );
  }
};
export default TodoApp;
